<?php

namespace Appleton\Taxes\Seeds\US\Alabama;

use Appleton\Taxes\Countries\US\Alabama\BessemerOccupational;
use DB;
use Illuminate\Database\Seeder;

class BessemerSeeder extends Seeder
{
    public function run()
    {
        if (DB::table(config('taxes.governmental_unit_areas'))->where('name', 'Bessemer, AL')->exists()) return;

        $id = DB::table(config('taxes.governmental_unit_areas'))->insertGetId([
            'name' => 'Bessemer, AL',
            'area' => '',
        ]);

        DB::table(config('taxes.tax_areas'))->insert([
            'name' => 'Bessemer Occupational Tax',
            'tax' => BessemerOccupational::class,
            'governmental_unit_area_id' => $id,
        ]);
    }
}
